import React from "react";

const RegisterForm = () => {
  return (
    <form onSubmit={e => handleSubmit(e)}>
      {renderInput("username", "Username")}
      {renderInput("password", "Password", "password")}
      {renderButton("Login")}
    </form>
  );
};

export default RegisterForm;
